const Log = require("./middleware/logger");

async function main() {
  await Log("backend", "info", "app", "App started by Himani ðŸŸ¢");

  try {
    throw new Error("Simulated DB error");
  } catch (err) {
    await Log("backend", "fatal", "db", err.message);
  }

  await Log("frontend", "debug", "button", "User clicked login");
}

main();
